has been an incredible journey… lots of highs and many lows, however, they’ve all been part of this wonderful journey and I have learned so much about my mind, body and soul throughout this journey called life.</p><p class="gp-component-id-wMq6bbpVu"><br></p><p class="gp-component-id-0Lj4d4SBN0">Have you noticed that when you don’t feel so good about yourself mentally, how it affects every facet of your being?</p><p class="gp-component-id-Vqrk8K8Aj"><br></p><p class="gp-component-id-Ng3XCDu0_0">Once that cycle begins it seems unstoppable, you don’t want to eat, you become lethargic, tired, you have no energy, life loses its lustre, you lose your appetite, and everything simply spirals downwards.</p><p class="gp-component-id-Rm0VwmYE9"><br></p><p class="gp-component-id-p6ddPMqVh2">Even though it’s one of the best things you can, exercise is the last thing on your mind, and if you do feel hungry you grab the nearest easy thing to eat, usually high sugar and stuff it your face washed down with copious amounts of tea or coffee just to get through your day.</p><p class="gp-component-id-e3EW_CeWqz"><br></p><p class="gp-component-id-2dD4RXdDNd">It becomes a self-fulfilling prophecy!</p><p class="gp-component-id-eHKS0dXfd7V"><br></p><p class="gp-component-id-zI82jx9Y0q">You thought it, you felt it…therefore you created it!</p><p class="gp-component-id-Ic5ZK0ovhq6"><br></p><p class="gp-component-id-r3Z5sEazgP">But this is where the magic begins…</p><p class="gp-component-id-DviZHLR4N"><br></p><p class="gp-component-id-VEAzdsoDnf">Read through that last sentence again, slowly… &nbsp;You thought it, YOU felt it…therefore YOU created it!</p><p class="gp-component-id-9yHd0AYVd3">How powerful and empowering is that?</p><p class="gp-component-id-ynOjl0SfZ"><br></p><p class="gp-component-id-kZam_nnRdU">When you are having fun in your life, when you are in your flame, nothing is impossible.</p><p class="gp-component-id-TbUN51qHskT"><br></p><p class="gp-component-id-ddVtNvefu_">Projecting your confidence as a shield of invincibility will bring great gifts into your life.</p><p class="gp-component-id-vTU5VGp6N"><br></p><p class="gp-component-id-NLy97LCjOq">Life and food are there to enjoy, eat to suit your own unique personality and your own unique lifestyle, that’s the key and it works.</p><p class="gp-component-id-Si51gk79oZI"><br></p><p class="gp-component-id-KwL74SzB0i">Take away the fear and everything falls into place.</p><p class="gp-component-id-P9WAEAyiV"><br></p><p class="gp-component-id-p68_D0hc2">If you think about it logically, your life today was created by the thoughts, actions and words you had yesterday, last week, last month, last year… so doesn’t logic tells you that if you change your thoughts today, tomorrow, next week, next month how different could you and your life be next year!</p><p class="gp-component-id-Ilk_07lq6"><br></p><p class="gp-component-id-7wFbKuTLso">Exercise, eat well, change your thoughts and be a magnet for positivity create a kick ass mindset, and live the life you’ve always wanted and desired in just 20 minutes a day.</p></div></div></div>
